import './App.css';
import React, { useState } from "react";
import TodoForm from "./Components/TODOFORM";
import TodoList from "./Components/TODOLIST"; 
function App() {
  const [todos, setTodos] = useState([]);

  function addTodo(todo) {
      setTodos([todo, ...todos]);
  }
  return (
    <div className="App">
      <p> React Todo </p>
      <TodoForm addTodo={addTodo} />
    </div>
  );
}

export default App;
